import {
  Box,
  Button,
  Link,
  Paper,
  Stack,
  Tooltip,
  Typography,
} from '@mui/material';
import ChevronRightIcon from '@mui/icons-material/ChevronRight';
import { ReactNode } from 'react';
import OpenInNewIcon from '@mui/icons-material/OpenInNew';
import { createDockerDesktopClient } from '@docker/extension-api-client';

const client = createDockerDesktopClient();

export function DeprecationNotice({ onClose }: { onClose: () => void }) {
  return (
    <Stack spacing={2}>
      <Paper variant="outlined">
        <Box
          sx={(theme) => ({
            p: 2,
            borderBottom: `1px solid ${theme.palette.divider}`,
          })}
        >
          <Typography variant="h4" component="span">
            MCP Toolkit is now
          </Typography>{' '}
          <Typography
            variant="h4"
            component="span"
            fontWeight={700}
            sx={{
              color: 'primary.main',
              textDecoration: (theme) =>
                `wavy underline ${theme.palette.primary.main}`,
            }}
          >
            integrated with Docker Desktop
          </Typography>
        </Box>
        <Box sx={{ position: 'relative' }}>
          <Box
            sx={{
              position: 'absolute',
              inset: 0,
              overflow: 'hidden',
              pointerEvents: 'none',
              mixBlendMode: 'darken',
            }}
          >
            <ConfettiSvg height="100%" />
          </Box>
          <Stack
            spacing={1}
            direction="row"
            alignItems="center"
            sx={{
              flexWrap: { xs: 'wrap', sm: 'nowrap' },
              p: 2,
            }}
          >
            <Box>
              <Typography variant="body1">
                We want to say thank you for being an integral part of our beta
                testing program.
              </Typography>
              <Typography variant="body1" gutterBottom>
                <strong>
                  Your feedback and use of the beta feature have been
                  instrumental in shaping its development.
                </strong>
              </Typography>

              <Typography variant="body2" gutterBottom>
                We're continuing to improve this feature based on your feedback.
                If you have more input or run into issues, let us know.
              </Typography>

              <ExternalLink href="https://dockercommunity.slack.com/signup#/domain-signup">
                Send feedback
              </ExternalLink>
            </Box>
            <Box
              sx={{
                flexGrow: 1,
              }}
            >
              <ServerIconsSvg />
            </Box>
          </Stack>
        </Box>
      </Paper>
      <QuestionSection
        question="Where can I learn more about the Docker MCP Toolkit?"
        answer={
          <Box>
            Read the documentation about{' '}
            <ExternalLink href="https://docs.docker.com/go/mcp-toolkit">
              Docker MCP Tookit
            </ExternalLink>{' '}
            and discover the{' '}
            <ExternalLink href="https://hub.docker.com/mcp">
              Docker MCP Marketplace
            </ExternalLink>
          </Box>
        }
      />
      <QuestionSection
        question="How do I use the integrated Docker MCP Toolkit?"
        answer={
          <Box>
            Update Docker Desktop (you need to use version 4.42 or above) to be
            able to use this feature.{' '}
            <ExternalLink href="https://docs.docker.com/desktop/release-notes/">
              Update Docker Desktop
            </ExternalLink>
          </Box>
        }
      />
      <QuestionSection
        question="What should I do with the MCP Toolkit extension?"
        answer={
          <Stack spacing={1}>
            We recommend keeping the MCP Toolkit extension installed until
            you've confirmed that everything is accessible and working as
            expected in the new Docker Desktop integration. In most cases, your
            servers, configurations, secrets, and clients appear automatically.
            Once you've verified that everything is in place, you can uninstall
            the extension and continue using the integrated experience.
            <Box>
              <Button onClick={onClose} variant="outlined">
                Continue using the extension
              </Button>
            </Box>
          </Stack>
        }
      />
    </Stack>
  );
}

function QuestionSection({
  question,
  answer,
}: {
  question: string;
  answer: ReactNode;
}) {
  return (
    <Stack spacing={1}>
      <Stack direction="row" alignItems="center" spacing={1}>
        <ChevronRightIcon />
        <Typography variant="subtitle1">{question}</Typography>
      </Stack>
      <Stack direction="row" alignItems="center" spacing={1}>
        <ChevronRightIcon sx={{ visibility: 'hidden' }} />
        {answer}
      </Stack>
    </Stack>
  );
}

function ExternalLink({
  href,
  children,
}: {
  href: string;
  children: ReactNode;
}) {
  return (
    <Tooltip title={href} placement="top">
      <span>
        <Link
          href="#"
          target="_blank"
          rel="noopener noreferrer"
          onClick={() => client.host.openExternal(href)}
        >
          {children}
          <OpenInNewIcon fontSize="inherit" />
        </Link>
      </span>
    </Tooltip>
  );
}

